import { useState } from 'react'



const linkStyle = {
    background: "#F3F3F3", 
    height: "100px",
    width: "100px"
  };

export default function Index() {
    const [rValue, setRValue] = useState(200)
    const [gValue, setGValue] = useState(200)
    const [bValue, setBValue] = useState(200)
    return (
      <div style={linkStyle}>
        <p>Hello Next.js</p>

        <p>Red</p>
        {rValue}

        <p>Green</p>
        {gValue}

        <p>Blue</p>
        {bValue}

        <input 
        type="text"
        placeholder = "Enter R value"
        onChange = {(e) => setRValue(e.target.value)}
        />


      </div>
    );
  }
